declare namespace CommonUser {
    interface ILoginOptions {
        [index: string]: any;
    }

    interface IPasswordLoginOptions extends ILoginOptions {
        account?: string;
        password: string;
    }

    interface IFacebookLoginOptions extends ILoginOptions, Platform.IFacebookResult {}

    interface IAutoLoginOptions extends ILoginOptions {}

    interface ILoginResult {
        result: import("./define/CommonResultType").CommonResultType;
        content: any;
    }

    type TLoginResultWithType<T> =
        | {
              result: import("./define/CommonResultType").CommonResultType.Success;
              content: T;
          }
        | {
              result: import("./define/CommonResultType").CommonResultType.Failed;
              content: RespHeader;
          };
}
